--
-- Triggers `standardcompliancechecklist`
--
DELIMITER $$
CREATE TRIGGER `update_permits_and_safety_before_insert` BEFORE INSERT ON `standardcompliancechecklist` FOR EACH ROW BEGIN
    -- Check valid permits (assuming you've added valid_permits column)
    IF NEW.valid_permit_LGU = 0 OR NEW.valid_permit_BFP = 0 OR NEW.valid_permit_DENR = 0 THEN
        SET NEW.valid_permits = 0;
    ELSE
        SET NEW.valid_permits = 1;
    END IF;

    -- Check consumer safety (fixed column name consistency)
    IF NEW.cel_warn = 0 OR NEW.smoke_sign = 0 OR NEW.switch_eng = 0 OR NEW.straddle = 0 THEN
        SET NEW.consume_safety = 0;
    ELSE
        SET NEW.consume_safety = 1;
    END IF;
    
    -- Check price display (modified logic for tinyint fields)
    IF NEW.pdb_entry = 1 AND NEW.pdb_updated = 1 AND NEW.pdb_match = 1 THEN
        SET NEW.price_display = 1;
    ELSE
        SET NEW.price_display = 0;
    END IF;
END
$$
DELIMITER ;

